import {CroctProvider} from '@croct/plug-react'

function Inicio(){
  return (
    <div id="Page">
  <div><h1>Seja bem-vindo a Croct!</h1> </div>
  <div><p></p></div></div>)
}
function App() {
  return (
    <CroctProvider appId="00000000-0000-0000-0000-000000000000"> 
    <Inicio/>
    </CroctProvider>
  );
}

export default App;
